import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Register() {
    const [image, setImage] = useState(null);
    const [preview, setPreview] = useState(null);
    const [name, setName] = useState('');
    const [address, setAddress] = useState('');
    const [latitude, setLatitude] = useState('');
    const [longitude, setLongitude] = useState('');
    const [memo, setMemo] = useState('');

    const GOOGLE_CLOUD_VISION_API_KEY = 'AIzaSyA2bEOpkNhnfSIsYqVgFD0PNcRF6jFooAE'
    const GOOGLE_CLOUD_GEOCODING_API_KEY = 'AIzaSyCLg__BpwjAl8zSJ741LouSvrwuUe__J-Q'

    useEffect(() => {
        const script = document.createElement('script');
        script.src = `https://maps.googleapis.com/maps/api/js?key=${GOOGLE_CLOUD_GEOCODING_API_KEY}`;
        script.async = true;
        document.body.appendChild(script);

        script.onload = () => {
            const geocoder = new window.google.maps.Geocoder();
            const addressInput = document.getElementById('address');
            addressInput.addEventListener('change', () => {
                geocoder.geocode({ address: addressInput.value }, (results, status) => {
                    if (status === 'OK') {
                        const { lat, lng } = results[0].geometry.location;
                        setLatitude(lat().toString());
                        setLongitude(lng().toString());
                    } else {
                        console.error('Geocode was not successful for the following reason: ' + status);
                    }
                });
            });
        };

        return () => {
            document.body.removeChild(script);
        };
    }, []);

    const handleImageChange = async (e) => {
        const file = e.target.files[0];
        setImage(file);
        setPreview(URL.createObjectURL(file));

        const reader = new FileReader();
        reader.readAsDataURL(file);
        reader.onloadend = async () => {
            const base64String = reader.result.split(',')[1];

            const requestPayload = {
                requests: [
                    {
                        image: {
                            content: base64String,
                        },
                        features: [
                            {
                                type: 'TEXT_DETECTION',
                            },
                        ],
                    },
                ],
            };

            try {
                const response = await axios.post(
                    `https://vision.googleapis.com/v1/images:annotate?key=${GOOGLE_CLOUD_VISION_API_KEY}`,
                    requestPayload,
                    {
                        headers: {
                            'Content-Type': 'application/json',
                        },
                    }
                );

                if (response.data.responses[0].textAnnotations) {
                    const detections = response.data.responses[0].textAnnotations;
                    const detectedText = detections[0] ? detections[0].description : 'No text detected';
                    const extractedAddress = extractAddress(detectedText);
                    setAddress(extractedAddress);
                    setMemo(detectedText);
                } else {
                    console.error('No text annotations found');
                }
            } catch (error) {
                console.error('Failed to fetch text from image', error);
            }
        };
    };

    const extractAddress = (text) => {
        // 문자열에서 '시', '구', '로', '길', '대로' 뒤에 공백이 없으면 추가해줍니다.
        let modifiedText = text.replace(/(?:시|도|군|구|로|길|대로)(?!\s)/g, '$& ');

        // 수정된 문자열을 사용하여 정규 표현식으로 주소 패턴을 찾습니다.
        const addressRegex = /(?:[\w\s]+(?:시|도|군|구)?\s)?[\w\s]+(?:로|길|대로)\s\d+(?:-\d+)?(?:번길)?/g;
        const match = modifiedText.match(addressRegex);

        // 찾은 주소를 반환합니다.
        return match ? match[0].trim() : 'Address not found';
    };


    const handleSubmit = (event) => {
        event.preventDefault();
        console.log('Image:', image);
        console.log('Name:', name);
        console.log('Address:', address);
        console.log('Latitude:', latitude);
        console.log('Longitude:', longitude);
        console.log('Memo:', memo)
    };

    const handleReset = () => {
        setImage(null);
        setPreview(null);
        setName('');
        setAddress('');
        setLatitude('');
        setLongitude('');
        setMemo('');
    };

    return (
        <div>
            <h1>Register</h1>
            <form onSubmit={handleSubmit}>
                <label>
                    Image:
                    <input type="file" onChange={handleImageChange} />
                </label>
                <br />
                {preview && (
                    <div>
                        <img src={preview} alt="Preview" style={{ maxWidth: '200px' }} />
                    </div>
                )}
                <label>
                    Address:
                    <input type="text" id="address" value={address} onChange={(e) => setAddress(e.target.value)} />
                </label>
                <br />
                <label>
                    Name:
                    <input type="text" value={name} readOnly />
                </label>
                <br />
                <label>
                    Latitude:
                    <input type="text" value={latitude} readOnly />
                </label>
                <br />
                <label>
                    Longitude:
                    <input type="text" value={longitude} readOnly />
                </label>
                <br />
                <label>
                    Memo:
                    <input type="text" value={memo}></input>
                </label>
                <br />
                <button type="submit">Submit</button>
                <button type="button" onClick={handleReset}>Reset</button>
            </form>
        </div>
    );
}

export default Register;
